#
# Experimental HZ-GB/J, an itaiji-switched version of GB 2312 or GB/T 12345 (itself largely itaiji
# swaps of each other), following GB where possible (adding GB/T extensions, with switching), also
# with additional extensions to improve Japanese support, for use in HZ encoding with Japanese.
#
# Note that the empty space in the GB 2312 subset of GB 18030 is mapped to the PUA so it's not
# exactly reserved.
#
# Changes make it capable of encoding 93.2% of JIS X 0208:
#
# - 3886 JIS X 0208 kanji and non-kanji characters, or 54.7% of its repertoire, with existing
#   GB 2312 (plus artificial GB 2312 parallel of GB/T 12345 extensions) representations.
# - Three extended Hiragana to parallel the Katakana row as in JIS X 0213 (new assignments) and
#   three reservations needed by the HZ code mechanism.
# - 1490 JIS X 0208 kanji characters, or 21.0% of its repertoire, by applying itaiji swaps from
#   Simplified Chinese (etc) to Japanese.
# - 1247 JIS X 0208 characters, or 17.5% of its repertoire, in new assignments whereëver there was
#   space.
# - 2207 GB 2312 characters (in the original or in GB 2312 subset of GB 18030) which were not
#   present in or swappable with JIS X 0208 are included untouched.
#
# Is missing 487 of the level 2 kanji (6.8% of the repertoire).
#
